package main

import "testing"

func TestExample1(t *testing.T) {
	word1 := "abc"
	word2 := "bca"
	expected := true

	result := closeStrings(word1, word2)

	if result != expected {
		t.Errorf("Expected %v, got %v", expected, result)
	}
}

